import React from 'react'

const Users = ({loading,users}) => {
    return loading ? (   
          <div id="main">
            <img src="https://upload.wikimedia.org/wikipedia/commons/b/b1/Loading_icon.gif" alt="Loaading.." className="loader"/>
            {/* <img src="https://media0.giphy.com/media/xTk9ZvMnbIiIew7IpW/200w.webp?cid=ecf05e477peu97kgdmel1pt53mfrdrz0mzckuww848qdwt7c&rid=200w.webp&ct=g" alt="Loaading.." className="loader"/> */}
          </div>
        ) : 
        (
          <div id="main">

          {users.map(user =>
                      <div className="project column3">
                        {
                          console.log(user)
                        }
                        <div className="profile">
                          <img src={user.avatar} alt={user.avatar} className="avatar"></img>
                          <h1 className="name">{user.first_name} {user.last_name}</h1>
                          <p className="email">{user.email}</p>
                          <p>User ID: {user.id}</p>
                        </div>
                      </div>
            )
          }
          </div>
        )
}

export default Users;
